import React, {Component} from 'react';
import s from './Profile.module.css';
import MyPosts from "./MyPosts/MyPosts";
import ProfileData from "../Dialogs/ProfileData";

const Profile = () => {

    let profiles = [
        {
            userName: 'Andruha',
            birthDay: '12.08.1984',
            city: 'Minsck',
            aducation: 'higher',
            webSite: 'drunya35@gmail.com'
        },
        {
            userName: 'Dimich',
            birthDay: '02.01.1989',
            city: 'Minsck',
            aducation: 'higher',
            webSite: 'itcamasutra.com'
        }
    ]

    return (
        <div className={s.profilePage}>
            <div>
                <img src='http://novostrojka.by/upload/pic/760d0d546bed5eea4668e7e220c22d38.jpg' className={s.fon}/>
            </div>

            <div className={s.userData}>
                <div>
                    <img src='https://i.ytimg.com/vi/ToNcTEAEUqo/maxresdefault.jpg' className={s.avatar}/>
                </div>

                {
                    profiles.map((el, i) => {
                        return (
                            <ProfileData key={i} userName={el.userName} birthDay={el.birthDay} city={el.city} aducation={el.aducation} webSite={el.webSite}/>
                        )

                    })
                }
            </div>

            <MyPosts/>
        </div>

    );
}

export default Profile
